                "/" +
                product.title +
                "/" +
                product.price
              }>
                <Card imgsrc={product.imgsrc} title={product.title} price={product.price} />
                </Link>
              </>
            );
          })}
        </div>

      </div>
    </>
  );
};

export default SCard;
